import React from 'react';

const SaveComponentForm = () => {

  const handleSave = (e) => {
    e.preventDefault();
    fetch("http://localhost:8080/user_components", {
      method: "POST",
      headers: {
        "Content-Type": "application/json"
      },
      body: JSON.stringify({
        name: e.target[0].value,
        user_id: userState.currentUser.id,
        js: codeState.js,
        css: codeState.css,
        html: codeState.html,
        img_src: "https://pics.me.me/thumb_pepehands-emote-pepe-t-shirt-teepublic-51219604.png",
      })
    })
      .then(res => res.json())
      .then(comp => {
        console.log(comp);
      });
  };

  return (
    <form onSubmit={handleSave}>
      <label>Component Name: </label>
      <input type="text" />
      <br />
      <button type="submit">Save</button>
    </form>
  );
};

export default SaveComponentForm;
